import { Component } from '@angular/core';

@Component({
    selector: 'app-root',
    templateUrl: './appcomponent.html',
    styleUrls: ['./appcomponent.scss']
})
export class AppComponent {
    title = 'GymWear - Tu Tienda de Ropa Deportiva';
}
